import{_ as n,o as s,c as a,h as e}from"./app-4af1fca6.js";const p="/assets/4-1.structure-978fd462.png",t="/assets/4-2.prototype-01-92521eb4.png",o="/assets/4-2.prototype-02-b22ef9be.png",c="/assets/4-2.prototype-03-396411de.png",l="/assets/4-2.prototype-04-60fe2489.png",i="/assets/4-4-get-set-prototype-d9e5e3e7.png",r="/assets/4-5-properties-343d25db.png",u="/assets/4-6-proto-3badd9ca.png",d={},k=e(`<h1 id="第-4-章-对象概述" tabindex="-1"><a class="header-anchor" href="#第-4-章-对象概述" aria-hidden="true">#</a> 第 4 章 对象概述</h1><h2 id="_4-1-对象概述" tabindex="-1"><a class="header-anchor" href="#_4-1-对象概述" aria-hidden="true">#</a> 4 - 1 对象概述</h2><h3 id="概述" tabindex="-1"><a class="header-anchor" href="#概述" aria-hidden="true">#</a> 概述</h3><p>对象中包含一系列属性，这些属性是<strong>无序</strong>的。<br> 每个属性都有一个<strong>字符串 key</strong>和对应的 value。</p><div class="language-javascript line-numbers-mode" data-ext="js"><pre class="language-javascript"><code><span class="token keyword">var</span> obj <span class="token operator">=</span> <span class="token punctuation">{</span><span class="token punctuation">}</span>
obj<span class="token punctuation">[</span><span class="token number">1</span><span class="token punctuation">]</span> <span class="token operator">=</span> <span class="token number">1</span>
obj<span class="token punctuation">[</span><span class="token string">&#39;1&#39;</span><span class="token punctuation">]</span> <span class="token operator">=</span> <span class="token number">2</span>
obj <span class="token comment">// Object {1: 2}</span>
<span class="token comment">// 上面可以看错，不管是数字型的1作为属性，还是字符串型的&#39;1&#39;作为属性，他们指向同一个属性。</span>

obj<span class="token punctuation">[</span><span class="token punctuation">{</span><span class="token punctuation">}</span><span class="token punctuation">]</span> <span class="token operator">=</span> <span class="token boolean">false</span>
obj<span class="token punctuation">[</span><span class="token punctuation">{</span> <span class="token literal-property property">x</span><span class="token operator">:</span> <span class="token number">1</span> <span class="token punctuation">}</span><span class="token punctuation">]</span> <span class="token operator">=</span> <span class="token boolean">true</span>
obj <span class="token comment">// Object {1:2, [object Object]: true}</span>
<span class="token comment">// 同样，这里不管是空对象，还是属性x为1的对象作为key，都是把它们toString()之后作为key，他们最终指向同一个属性。</span>
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div></div></div><h3 id="对象结构" tabindex="-1"><a class="header-anchor" href="#对象结构" aria-hidden="true">#</a> 对象结构</h3><p>对象的每个属性都有一些便签，比如：</p><ul><li>writable</li><li>enumerable</li><li>configurable</li><li>value</li><li>get/set</li><li><code>__proto__</code></li><li>等等</li></ul><p>图示：</p><p><img src="`+p+'" alt="对象构造" loading="lazy"></p><h2 id="_4-2-创建对象、原型链" tabindex="-1"><a class="header-anchor" href="#_4-2-创建对象、原型链" aria-hidden="true">#</a> 4 - 2 创建对象、原型链</h2><h3 id="对象创建-字面量" tabindex="-1"><a class="header-anchor" href="#对象创建-字面量" aria-hidden="true">#</a> 对象创建-字面量</h3><p><code>var obj1 = {x: 1, y: 2};</code></p><h3 id="对象创建-new-原型链" tabindex="-1"><a class="header-anchor" href="#对象创建-new-原型链" aria-hidden="true">#</a> 对象创建-new/原型链</h3><p>使用 new 构造对象的好处，对象的原型会指向构造器的 prototype 属性。</p><p>当访问一个对象的属性时，先看该对象有没有这个属性，如果有就使用该对象的该属性值，如果没有，则向上查找该对象的原型链上有没有这个属性。<br> 当查找到最后的 prototype 为 null 时还没有查找到，就返回 undefined.</p><p>注意<code>in</code>和<code>hasOwnProperty</code>的区别。</p><p>原型链示意图：</p><p><img src="'+t+'" alt="原型链示意图" loading="lazy"></p><p>但是，当给对象的属性赋值的时候，不会通过原型链向上查找。<br> 也就是说，当给对象的属性赋值时，会看这个对象上有没有这个属性，如果有，直接修改属性的值；<br> 如果没有，直接在这个对象上新加这个属性，而不会修改对象原型链上的值。</p><p>示意图：</p><p><img src="'+o+'" alt="示意图" loading="lazy"></p><p>如果给一个对象的属性赋值为 undefined 的话，这个属性还是存在的，只不过值为 undefined。<br> 所以，如果访问一个对象的属性时返回 undefined，不一定是对象没有这个属性，可能是有这个属性，只不过值为 undefined。<br> 此时，可以通过<code>hasOwnProperty</code>和<code>in</code>来区分。</p><p>如果所示：</p><p><img src="'+c+'" alt="属性赋值undefined" loading="lazy"></p><p>那么，如果要删掉对象的属性的话，使用<code>delete obj.z</code>去删除，删除后就可以通过<code>obj.z</code>访问到原型链上的值了。<br> 但是，如果继续<code>delete obj.z</code>的话，是不起作用的。<br> 也就是说，delete 只会删掉对象上的属性，而原型链上的属性不会受影响。</p><p>这样的话，就通过原型链实现了继承，对象可以访问原型链上的属性，但是有不会修改原型链上的属性。</p><h3 id="对象创建-object-create" tabindex="-1"><a class="header-anchor" href="#对象创建-object-create" aria-hidden="true">#</a> 对象创建-<code>Object.create</code></h3><p>除了用原型之外，还可以通过<code>Object.create</code>这个内置函数来创建对象。<br> 这个方法的作用是，创建一个对象，并且让这个对象的原型执行这个方法的参数。</p><p>如果所示：</p><p><img src="'+l+`" alt="Object.create" loading="lazy"></p><p>使用 obj.x 可以访问，但是这个 x 是 obj 的原型链上的，所以，hasOwnProperty 返回 false。</p><p>并不是所有对象的原型链末端都是 Object.prototype，也就是说不是说有的对象都有 toString 方法。</p><p>比如上图所示，使用<code>Object.create(null)</code>创建的对象，它的原型直接就是 null 了，所以这个对象就不会 包含任何方法。</p><h2 id="_4-3-属性操作" tabindex="-1"><a class="header-anchor" href="#_4-3-属性操作" aria-hidden="true">#</a> 4 - 3 属性操作</h2><h3 id="属性读写" tabindex="-1"><a class="header-anchor" href="#属性读写" aria-hidden="true">#</a> 属性读写</h3><p>使用<code>obj.x</code>或<code>obj[&#39;y&#39;]</code>形式。</p><p>使用<code>for...in</code>遍历属性时，会把原型链上的东西遍历出来，并且他的顺序时不确定的。</p><div class="language-javascript line-numbers-mode" data-ext="js"><pre class="language-javascript"><code><span class="token keyword">var</span> p
<span class="token keyword">for</span> <span class="token punctuation">(</span>p <span class="token keyword">in</span> obj<span class="token punctuation">)</span> <span class="token punctuation">{</span>
  console<span class="token punctuation">.</span><span class="token function">log</span><span class="token punctuation">(</span>obj<span class="token punctuation">[</span>p<span class="token punctuation">]</span><span class="token punctuation">)</span>
<span class="token punctuation">}</span>
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div></div></div><h3 id="属性读写-异常" tabindex="-1"><a class="header-anchor" href="#属性读写-异常" aria-hidden="true">#</a> 属性读写-异常</h3><p>使用<code>obj.x = y</code>时，如果 x 属性存在就赋为 y，如果不存在就新建 x 属性，并赋值。</p><h3 id="属性删除" tabindex="-1"><a class="header-anchor" href="#属性删除" aria-hidden="true">#</a> 属性删除</h3><p>使用<code>delete obj.x</code>或<code>delete obj[x]</code>形式删除，删除之后 obj.x 就变为 undefined。</p><p>如果去删除不存在的属性，js 不去做任何事情，但是仍然返回 true，所以，返回 true 并不代表它删除成功了，而是说这个对象上不存在这个属性了。</p><p>但是，有些属性是不允许删除的，这时会返回 false，比如：</p><div class="language-javascript line-numbers-mode" data-ext="js"><pre class="language-javascript"><code><span class="token keyword">delete</span> <span class="token class-name">Object</span><span class="token punctuation">.</span>prototype <span class="token comment">// false</span>
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div></div></div><p>每个属性都有自己的一些权限配置，我们可以通过下面的方式获取：</p><div class="language-javascript line-numbers-mode" data-ext="js"><pre class="language-javascript"><code><span class="token keyword">var</span> descriptor <span class="token operator">=</span> Object<span class="token punctuation">.</span><span class="token function">getOwnPropertyDescriptor</span><span class="token punctuation">(</span>Object<span class="token punctuation">,</span> <span class="token string">&#39;prototype&#39;</span><span class="token punctuation">)</span>
descriptor<span class="token punctuation">.</span>configurable <span class="token comment">// false</span>
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div></div></div><p>除此之外，使用 var 定义的全局变量或局部变量，仍然不能被删除，虽然它不是对象的属性。比如：</p><div class="language-javascript line-numbers-mode" data-ext="js"><pre class="language-javascript"><code><span class="token keyword">var</span> globalVal <span class="token operator">=</span> <span class="token number">1</span>
<span class="token keyword">delete</span> globalVal <span class="token comment">// false;</span>
<span class="token punctuation">;</span><span class="token punctuation">(</span><span class="token keyword">function</span> <span class="token punctuation">(</span><span class="token punctuation">)</span> <span class="token punctuation">{</span>
  <span class="token keyword">var</span> localVal <span class="token operator">=</span> <span class="token number">1</span>
  <span class="token keyword">return</span> <span class="token keyword">delete</span> localVal
<span class="token punctuation">}</span><span class="token punctuation">)</span><span class="token punctuation">(</span><span class="token punctuation">)</span> <span class="token comment">// false</span>

<span class="token comment">// 同理，函数也一样</span>
<span class="token keyword">function</span> <span class="token function">fd</span><span class="token punctuation">(</span><span class="token punctuation">)</span> <span class="token punctuation">{</span><span class="token punctuation">}</span>
<span class="token keyword">delete</span> fd <span class="token comment">// false</span>
<span class="token punctuation">;</span><span class="token punctuation">(</span><span class="token keyword">function</span> <span class="token punctuation">(</span><span class="token punctuation">)</span> <span class="token punctuation">{</span>
  <span class="token keyword">function</span> <span class="token function">fd</span><span class="token punctuation">(</span><span class="token punctuation">)</span> <span class="token punctuation">{</span><span class="token punctuation">}</span>
  <span class="token keyword">return</span> <span class="token keyword">delete</span> fd
<span class="token punctuation">}</span><span class="token punctuation">)</span><span class="token punctuation">(</span><span class="token punctuation">)</span> <span class="token comment">// false</span>

<span class="token comment">// 注意，不使用var定义的这种可以删除。</span>
ohNo <span class="token operator">=</span> <span class="token number">1</span>
window<span class="token punctuation">.</span>ohNo <span class="token comment">// 1</span>
<span class="token keyword">delete</span> ohNo <span class="token comment">// true</span>

<span class="token comment">// 还有中情况，eval里定义的变量是可以删除的。</span>
<span class="token function">eval</span><span class="token punctuation">(</span><span class="token string">&#39;var a = 1;&#39;</span><span class="token punctuation">)</span>
<span class="token keyword">delete</span> a <span class="token comment">// true</span>
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div></div></div><h3 id="属性检测" tabindex="-1"><a class="header-anchor" href="#属性检测" aria-hidden="true">#</a> 属性检测</h3><p>可以使用 in 操作符来检测，它能访问原型链上的属性，可以用 hasOwnProperty 来检测是否是原型链上的属性。</p><p>但是，使用 in 遍历时，不是每个属性都会输出，可以使用<code>obj.propertyIsEnumerable(&#39;x&#39;)</code>的形式来判断属性是否可以被枚举。</p><p>我们可以使用 defineProperty 来自定义属性，并且可以设为不可枚举。</p><div class="language-javascript line-numbers-mode" data-ext="js"><pre class="language-javascript"><code>Object<span class="token punctuation">.</span><span class="token function">defineProperty</span><span class="token punctuation">(</span>cat<span class="token punctuation">,</span> <span class="token string">&#39;price&#39;</span><span class="token punctuation">,</span> <span class="token punctuation">{</span> <span class="token literal-property property">enumerable</span><span class="token operator">:</span> <span class="token boolean">false</span><span class="token punctuation">,</span> <span class="token literal-property property">value</span><span class="token operator">:</span> <span class="token number">1000</span> <span class="token punctuation">}</span><span class="token punctuation">)</span>
cat<span class="token punctuation">.</span><span class="token function">propertyIsEnumerable</span><span class="token punctuation">(</span><span class="token string">&#39;price&#39;</span><span class="token punctuation">)</span> <span class="token comment">// false</span>
cat<span class="token punctuation">.</span><span class="token function">hasOwnProperty</span><span class="token punctuation">(</span><span class="token string">&#39;price&#39;</span><span class="token punctuation">)</span> <span class="token comment">// true</span>
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div></div></div><p>我们使用对象字面量或者<code>new</code>创建的对象，或者赋值创建的属性，它的属性都是可读可写，也是可以枚举，也可以 delete 掉。</p><p>而使用 defineProperty 创建的属性，如果不指定的话，它的标签都是 false 的，比如上面的 enumerable 不写也可以，默认 false。</p><p>补充，<code>if (a != undefined)</code>，等价于<code>if (a !== undefined || a !== null)</code>，不使用严格等于时，undefined 跟 null 当成一个东西。</p><h3 id="属性枚举" tabindex="-1"><a class="header-anchor" href="#属性枚举" aria-hidden="true">#</a> 属性枚举</h3><p>可以使用 propertyIsEnumerable 或者 hasOwnProperty 来枚举。<br> 注意，使用<code>var obj = Object.create(xxx)</code>创建出来的对象，它的原型指向后面的参数，比如这个 obj 的原型指向 xxx。</p><h2 id="_4-4-get-set-方法" tabindex="-1"><a class="header-anchor" href="#_4-4-get-set-方法" aria-hidden="true">#</a> 4-4 get/set 方法</h2><h3 id="getter-setter-使用" tabindex="-1"><a class="header-anchor" href="#getter-setter-使用" aria-hidden="true">#</a> getter/setter 使用</h3><p>Getter/Setter 的使用，是使用 get/set 关键字，加上字段名，紧接着跟着方法体。</p><p>Getter/Setter 跟其他属性之间，依然使用逗号隔开。</p><div class="language-javascript line-numbers-mode" data-ext="js"><pre class="language-javascript"><code><span class="token keyword">var</span> man <span class="token operator">=</span> <span class="token punctuation">{</span>
  <span class="token literal-property property">name</span><span class="token operator">:</span> <span class="token string">&#39;Bosn&#39;</span><span class="token punctuation">,</span>
  <span class="token literal-property property">weibo</span><span class="token operator">:</span> <span class="token string">&#39;@Boson&#39;</span><span class="token punctuation">,</span>
  <span class="token keyword">get</span> <span class="token function">age</span><span class="token punctuation">(</span><span class="token punctuation">)</span> <span class="token punctuation">{</span>
    <span class="token keyword">return</span> <span class="token keyword">new</span> <span class="token class-name">Date</span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">.</span><span class="token function">getFullYear</span><span class="token punctuation">(</span><span class="token punctuation">)</span> <span class="token operator">-</span> <span class="token number">1988</span>
  <span class="token punctuation">}</span><span class="token punctuation">,</span>
  <span class="token keyword">set</span> <span class="token function">age</span><span class="token punctuation">(</span><span class="token parameter">val</span><span class="token punctuation">)</span> <span class="token punctuation">{</span>
    console<span class="token punctuation">.</span><span class="token function">log</span><span class="token punctuation">(</span><span class="token string">&quot;Age can&#39;t be set to &quot;</span> <span class="token operator">+</span> val<span class="token punctuation">)</span>
  <span class="token punctuation">}</span><span class="token punctuation">,</span>
<span class="token punctuation">}</span>

console<span class="token punctuation">.</span><span class="token function">log</span><span class="token punctuation">(</span>man<span class="token punctuation">.</span>age<span class="token punctuation">)</span> <span class="token comment">// 27</span>
man<span class="token punctuation">.</span>age <span class="token operator">=</span> <span class="token number">100</span> <span class="token comment">// Age can&#39;t be set to 100</span>
console<span class="token punctuation">.</span><span class="token function">log</span><span class="token punctuation">(</span>man<span class="token punctuation">.</span>age<span class="token punctuation">)</span> <span class="token comment">// 27</span>
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div></div></div><p>一个稍微复杂的例子：</p><div class="language-javascript line-numbers-mode" data-ext="js"><pre class="language-javascript"><code><span class="token keyword">var</span> man <span class="token operator">=</span> <span class="token punctuation">{</span>
  <span class="token literal-property property">name</span><span class="token operator">:</span> <span class="token string">&#39;Bosn&#39;</span><span class="token punctuation">,</span>
  <span class="token literal-property property">weibo</span><span class="token operator">:</span> <span class="token string">&#39;@Boson&#39;</span><span class="token punctuation">,</span>
  <span class="token literal-property property">$age</span><span class="token operator">:</span> <span class="token keyword">null</span><span class="token punctuation">,</span> <span class="token comment">// 这里使用$，是为了不想把这个变量暴露给外面。注：实际man.$age还是可以访问的</span>
  <span class="token keyword">get</span> <span class="token function">age</span><span class="token punctuation">(</span><span class="token punctuation">)</span> <span class="token punctuation">{</span>
    <span class="token keyword">if</span> <span class="token punctuation">(</span><span class="token keyword">this</span><span class="token punctuation">.</span>$age <span class="token operator">==</span> <span class="token keyword">undefined</span><span class="token punctuation">)</span> <span class="token punctuation">{</span>
      <span class="token comment">// 这里没有使用严格等于，所以，这里实现了null和undefined判断</span>
      <span class="token keyword">return</span> <span class="token keyword">new</span> <span class="token class-name">Date</span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">.</span><span class="token function">getFullYear</span><span class="token punctuation">(</span><span class="token punctuation">)</span> <span class="token operator">-</span> <span class="token number">1988</span>
    <span class="token punctuation">}</span> <span class="token keyword">else</span> <span class="token punctuation">{</span>
      <span class="token keyword">return</span> <span class="token keyword">this</span><span class="token punctuation">.</span>$age
    <span class="token punctuation">}</span>
  <span class="token punctuation">}</span><span class="token punctuation">,</span>
  <span class="token keyword">set</span> <span class="token function">age</span><span class="token punctuation">(</span><span class="token parameter">val</span><span class="token punctuation">)</span> <span class="token punctuation">{</span>
    val <span class="token operator">=</span> <span class="token operator">+</span>val <span class="token comment">// 这里使用一元操作符+，可以将字符串转为数值。注：+不会将负值转为正值，+(-10)为-10</span>
    <span class="token keyword">if</span> <span class="token punctuation">(</span><span class="token operator">!</span><span class="token function">isNaN</span><span class="token punctuation">(</span>val<span class="token punctuation">)</span> <span class="token operator">&amp;&amp;</span> val <span class="token operator">&gt;</span> <span class="token number">0</span> <span class="token operator">&amp;&amp;</span> val <span class="token operator">&lt;</span> <span class="token number">150</span><span class="token punctuation">)</span> <span class="token punctuation">{</span>
      <span class="token keyword">this</span><span class="token punctuation">.</span>$age <span class="token operator">=</span> <span class="token operator">+</span>val
    <span class="token punctuation">}</span> <span class="token keyword">else</span> <span class="token punctuation">{</span>
      <span class="token keyword">throw</span> <span class="token keyword">new</span> <span class="token class-name">Error</span><span class="token punctuation">(</span><span class="token string">&#39;Incorrect val = &#39;</span> <span class="token operator">+</span> val<span class="token punctuation">)</span>
    <span class="token punctuation">}</span>
  <span class="token punctuation">}</span><span class="token punctuation">,</span>
<span class="token punctuation">}</span>

console<span class="token punctuation">.</span><span class="token function">log</span><span class="token punctuation">(</span>man<span class="token punctuation">.</span>age<span class="token punctuation">)</span> <span class="token comment">// 27</span>
man<span class="token punctuation">.</span>age <span class="token operator">=</span> <span class="token number">100</span>
console<span class="token punctuation">.</span><span class="token function">log</span><span class="token punctuation">(</span>man<span class="token punctuation">.</span>age<span class="token punctuation">)</span> <span class="token comment">// 100</span>
man<span class="token punctuation">.</span>age <span class="token operator">=</span> <span class="token string">&#39;abc&#39;</span> <span class="token comment">// error: Incorrect val = NaN 注：这里是NaN，而不是&#39;abc&#39;，因为在val = +val中就出错了。+&#39;abc&#39;为NaN</span>
<span class="token comment">// 如果去掉val = +val，执行man.age = &#39;abc&#39;时，返回：Incorrect val = abc</span>
man<span class="token punctuation">.</span>age <span class="token operator">=</span> <span class="token operator">-</span><span class="token number">10</span> <span class="token comment">// error: Incorrect val = -10</span>
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div></div></div><h3 id="get-set-与原型链" tabindex="-1"><a class="header-anchor" href="#get-set-与原型链" aria-hidden="true">#</a> get/set 与原型链</h3><p>如图所示：</p><p><img src="`+i+`" alt="get/set与原型链" loading="lazy"></p><p><code>obj.z; // 1</code></p><p>右上部分，为 foo.prototype 定义了一个 z 的 get 方法，使用 obj.z，由于 obj 中没有 z，所以向上查找原型链，得到原型上的 get 方法，所以返回 1。</p><div class="language-javascript line-numbers-mode" data-ext="js"><pre class="language-javascript"><code>obj<span class="token punctuation">.</span>z <span class="token operator">=</span> <span class="token number">10</span>
obj<span class="token punctuation">.</span>z <span class="token comment">// still 1</span>
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div></div></div><p>给 z 赋值时，由于 obj 上没有 z，按之前的讲解，应该会在 obj 上创建一个 z 属性，但是这里是失败了，因为仍然返回 1。</p><p>原因是，当 obj 上没有这个属性时，并且 obj 的原型链上有对应的 get/set 方法时，当对属性赋值时，它会走原型链上对应的 get/set 方法，而不会做对当前对象创建新属性的方式这样的处理。</p><p>那么，如果实现对 obj 上这样的属性进行修改呢。我们可以通过<code>Object.DefineProperty</code>来添加新属性。</p><p>如右下所示，使用<code>configurable: true</code>来指定属性可以被修改，这里没有指定 writebale 和 enumerable，所以默认是 false。</p><h2 id="_4-5-属性标签" tabindex="-1"><a class="header-anchor" href="#_4-5-属性标签" aria-hidden="true">#</a> 4 - 5 属性标签</h2><h3 id="查看属性标签" tabindex="-1"><a class="header-anchor" href="#查看属性标签" aria-hidden="true">#</a> 查看属性标签</h3><p>查看一个对象上的属性有哪些属性标签使用<code>Object.getOwnPropertyDescriptor(obj, prop)</code>，如下所示：</p><div class="language-javascript line-numbers-mode" data-ext="js"><pre class="language-javascript"><code>Object<span class="token punctuation">.</span><span class="token function">getOwnPropertyDescriptor</span><span class="token punctuation">(</span><span class="token punctuation">{</span> <span class="token literal-property property">pro</span><span class="token operator">:</span> <span class="token boolean">true</span> <span class="token punctuation">}</span><span class="token punctuation">,</span> <span class="token string">&#39;pro&#39;</span><span class="token punctuation">)</span>
<span class="token comment">// Object {value: true, writable: true, enumerable: true, configurable: true}</span>
<span class="token comment">// value: 属性的值</span>
<span class="token comment">// writable: 属性是否可修改，默认为true</span>
<span class="token comment">// enumerable: 属性是否可以被遍历，可被枚举(for..in或者Object.keys(&#39;xx&#39;))，默认为true</span>
<span class="token comment">// configurable: 是表示这些属性标签是否可以再被修改，另外，也表示是否可以通过delete去删除这个属性，默认为true</span>

Object<span class="token punctuation">.</span><span class="token function">getOwnPropertyDescriptor</span><span class="token punctuation">(</span><span class="token punctuation">{</span> <span class="token literal-property property">pro</span><span class="token operator">:</span> <span class="token boolean">true</span> <span class="token punctuation">}</span><span class="token punctuation">,</span> <span class="token string">&#39;a&#39;</span><span class="token punctuation">)</span> <span class="token comment">// undefined</span>
<span class="token comment">// 如果去获取一个不存在的属性的属性标签，将返回undefined</span>

<span class="token comment">// 定义属性使用Object.defineProperty</span>
<span class="token comment">// 第一个参数为对象，</span>
<span class="token comment">// 第二个参数为属性名</span>
<span class="token comment">// 第三个参数为属性标签对象</span>
<span class="token keyword">var</span> person <span class="token operator">=</span> <span class="token punctuation">{</span><span class="token punctuation">}</span>
Object<span class="token punctuation">.</span><span class="token function">defineProperty</span><span class="token punctuation">(</span>person<span class="token punctuation">,</span> <span class="token string">&#39;name&#39;</span><span class="token punctuation">,</span> <span class="token punctuation">{</span>
  <span class="token literal-property property">configurable</span><span class="token operator">:</span> <span class="token boolean">false</span><span class="token punctuation">,</span>
  <span class="token literal-property property">writable</span><span class="token operator">:</span> <span class="token boolean">false</span><span class="token punctuation">,</span>
  <span class="token literal-property property">enumerable</span><span class="token operator">:</span> <span class="token boolean">true</span><span class="token punctuation">,</span>
  <span class="token literal-property property">value</span><span class="token operator">:</span> <span class="token string">&#39;Bosn Ma&#39;</span><span class="token punctuation">,</span>
<span class="token punctuation">}</span><span class="token punctuation">)</span>

<span class="token comment">// 运行结果</span>
person<span class="token punctuation">.</span>name <span class="token comment">// Bosn Ma</span>
person<span class="token punctuation">.</span>name <span class="token operator">=</span> <span class="token number">1</span>
person<span class="token punctuation">.</span>name <span class="token comment">// still Bosn Ma</span>
<span class="token comment">// 上面的name没有赋值成功，因为writable为false</span>
<span class="token keyword">delete</span> person<span class="token punctuation">.</span>name <span class="token comment">// false</span>
<span class="token comment">// delete也不成功，因为configurable为false</span>
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div></div></div><p>一次性定义多个属性时，使用<code>Object.defineProperties(obj, properties)</code>，注意这里是复数形式。</p><p>第一个参数为对象，第二个参数是一个属性对象，这个对象的 key 是对象的属性，值为属性描述。</p><div class="language-javascript line-numbers-mode" data-ext="js"><pre class="language-javascript"><code>Object<span class="token punctuation">.</span><span class="token function">defineProperties</span><span class="token punctuation">(</span>person<span class="token punctuation">,</span> <span class="token punctuation">{</span>
  <span class="token literal-property property">title</span><span class="token operator">:</span> <span class="token punctuation">{</span> <span class="token literal-property property">value</span><span class="token operator">:</span> <span class="token string">&#39;fe&#39;</span><span class="token punctuation">,</span> <span class="token literal-property property">enumerable</span><span class="token operator">:</span> <span class="token boolean">true</span> <span class="token punctuation">}</span><span class="token punctuation">,</span>
  <span class="token literal-property property">corp</span><span class="token operator">:</span> <span class="token punctuation">{</span> <span class="token literal-property property">value</span><span class="token operator">:</span> <span class="token string">&#39;BABA&#39;</span><span class="token punctuation">,</span> <span class="token literal-property property">enumerable</span><span class="token operator">:</span> <span class="token boolean">true</span> <span class="token punctuation">}</span><span class="token punctuation">,</span>
  <span class="token literal-property property">salary</span><span class="token operator">:</span> <span class="token punctuation">{</span> <span class="token literal-property property">value</span><span class="token operator">:</span> <span class="token number">50000</span><span class="token punctuation">,</span> <span class="token literal-property property">enumerable</span><span class="token operator">:</span> <span class="token boolean">true</span><span class="token punctuation">,</span> <span class="token literal-property property">writable</span><span class="token operator">:</span> <span class="token boolean">true</span> <span class="token punctuation">}</span><span class="token punctuation">,</span>
<span class="token punctuation">}</span><span class="token punctuation">)</span>

Object<span class="token punctuation">.</span><span class="token function">getOwnPropertyDescriptor</span><span class="token punctuation">(</span>person<span class="token punctuation">,</span> <span class="token string">&#39;salary&#39;</span><span class="token punctuation">)</span>
<span class="token comment">// Object {value: 50000, writable: true, enumerable: true, configurable: false}</span>
<span class="token comment">// 使用defineProperty定义时，没有明确知道的标签，默认为false</span>

Object<span class="token punctuation">.</span><span class="token function">getOwnPropertyDescriptor</span><span class="token punctuation">(</span>person<span class="token punctuation">,</span> <span class="token string">&#39;corp&#39;</span><span class="token punctuation">)</span>
<span class="token comment">// Object {value: &#39;BABA&#39;, writable: false, enumerable: true, configurable: false}</span>
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div></div></div><p>属性的标签是可以重复设置的，我们可以再次使用 defineProperty 去修改对应属性的标签。</p><p>不同的标签是做不同的事情的，如下所示：<br><img src="`+r+'" alt="属性标签" loading="lazy"></p><div class="hint-container tip"><p class="hint-container-title">Tips</p><p>如果 configurable 为 true，即使其他标签为 false 也是可以被修改的，因为可以使用 defineProperty 再次定义为 true。</p></div><h2 id="_4-6-对象标签-对象序列化" tabindex="-1"><a class="header-anchor" href="#_4-6-对象标签-对象序列化" aria-hidden="true">#</a> 4 - 6 对象标签，对象序列化</h2><h3 id="对象标签" tabindex="-1"><a class="header-anchor" href="#对象标签" aria-hidden="true">#</a> 对象标签</h3><ul><li>[[proto]]</li><li>[[class]]</li><li>[[extensible]]</li></ul><h3 id="原型标签proto" tabindex="-1"><a class="header-anchor" href="#原型标签proto" aria-hidden="true">#</a> 原型标签<strong>proto</strong></h3><p><img src="'+u+`" alt="原型链" loading="lazy"></p><h3 id="class-标签" tabindex="-1"><a class="header-anchor" href="#class-标签" aria-hidden="true">#</a> class 标签</h3><p>没有直接的方式获取 class 标签，可以通过间接的方式<code>Object.prototype.toString</code>获取。</p><div class="language-javascript line-numbers-mode" data-ext="js"><pre class="language-javascript"><code><span class="token keyword">var</span> toString <span class="token operator">=</span> <span class="token class-name">Object</span><span class="token punctuation">.</span>prototype<span class="token punctuation">.</span>toString
<span class="token keyword">function</span> <span class="token function">getType</span><span class="token punctuation">(</span><span class="token parameter">o</span><span class="token punctuation">)</span> <span class="token punctuation">{</span>
  <span class="token keyword">return</span> <span class="token function">toString</span><span class="token punctuation">.</span><span class="token function">call</span><span class="token punctuation">(</span>o<span class="token punctuation">)</span><span class="token punctuation">.</span><span class="token function">slice</span><span class="token punctuation">(</span><span class="token number">8</span><span class="token punctuation">,</span> <span class="token operator">-</span><span class="token number">1</span><span class="token punctuation">)</span> <span class="token comment">// 从第9位截取，-1代表从后面数1位，即不包含最后一位。</span>
<span class="token punctuation">}</span>

<span class="token function">toString</span><span class="token punctuation">(</span><span class="token keyword">null</span><span class="token punctuation">)</span> <span class="token comment">// [object Null]</span>
<span class="token function">getType</span><span class="token punctuation">(</span><span class="token keyword">null</span><span class="token punctuation">)</span> <span class="token comment">// Null</span>
<span class="token function">getType</span><span class="token punctuation">(</span><span class="token keyword">undefined</span><span class="token punctuation">)</span> <span class="token comment">// Undefined</span>
<span class="token function">getType</span><span class="token punctuation">(</span><span class="token number">1</span><span class="token punctuation">)</span> <span class="token comment">// Number</span>
<span class="token function">getType</span><span class="token punctuation">(</span><span class="token keyword">new</span> <span class="token class-name">Number</span><span class="token punctuation">(</span><span class="token number">1</span><span class="token punctuation">)</span><span class="token punctuation">)</span> <span class="token comment">// Number</span>
<span class="token keyword">typeof</span> <span class="token keyword">new</span> <span class="token class-name">Number</span><span class="token punctuation">(</span><span class="token number">1</span><span class="token punctuation">)</span> <span class="token comment">// object</span>
<span class="token function">getType</span><span class="token punctuation">(</span><span class="token boolean">true</span><span class="token punctuation">)</span> <span class="token comment">// Boolean</span>
<span class="token function">getType</span><span class="token punctuation">(</span><span class="token keyword">new</span> <span class="token class-name">Boolean</span><span class="token punctuation">(</span><span class="token boolean">true</span><span class="token punctuation">)</span><span class="token punctuation">)</span> <span class="token comment">// Boolean</span>
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div></div></div><h3 id="extensible-标签" tabindex="-1"><a class="header-anchor" href="#extensible-标签" aria-hidden="true">#</a> extensible 标签</h3>`,96),v=[k];function m(b,g){return s(),a("div",null,v)}const y=n(d,[["render",m],["__file","chapter04.html.vue"]]);export{y as default};
